import React from 'react';
import { useParams } from 'react-router-dom';
import userImage from '../assets/user.jpg'; 

const users = [
  {
    id: 1,
    name: 'Chelsea Lynch',
    major: 'Computer Science',
    school: 'Stetson University',
    employmentStatus: 'Student Intern',
    location: 'Deland, FL',
    profilePhoto: userImage, 
    bio: 'I am a senior computer science major, working as a software intern.',
  },
  {
    id: 2,
    name: 'Lui McFarlane',
    major: 'Engineering',
    school: 'Stetson University',
    employmentStatus: 'Student Intern',
    location: 'Orlando, FL',
    profilePhoto: userImage, 
    bio: 'Passionate about my degree and looking forward to a full-time position next Spring.',
  },
  {
    id: 3,
    name: 'Kim McFarlane',
    major: 'Cybersecurity',
    school: 'Stetson University',
    employmentStatus: 'Employed',
    location: 'Apopka, FL',
    profilePhoto: userImage, 
    bio: 'Passionate about secure coding and currently seeking job opportunities.',
  },
  {
    id: 4,
    name: 'Keely Reid',
    major: 'Economics',
    school: 'Stetson University',
    employmentStatus: 'Unemployed',
    location: 'Deltona, FL',
    profilePhoto: userImage, 
    bio: 'Passionate about Economics & Global Health, currently seeking job opportunities.',
  },
];

const UserProfile = () => {
  const { userId } = useParams();
  const user = users.find((u) => u.id === parseInt(userId));

  if (!user) {
    return <div>User not found!</div>;
  }

  return (
    <div className="container mt-5">
      <h1>{user.name}'s Profile</h1>
      <div className="row">
        <div className="col-md-4">
          <img
            src={user.profilePhoto}
            alt={user.name}
            className="img-fluid rounded-circle"
            style={{ width: '200px', height: '200px', objectFit: 'cover' }}
          />
        </div>
        <div className="col-md-8">
          <h3>Details</h3>
          <p><strong>Major:</strong> {user.major}</p>
          <p><strong>School:</strong> {user.school}</p>
          <p><strong>Employment Status:</strong> {user.employmentStatus}</p>
          <p><strong>Location:</strong> {user.location}</p>
          <p><strong>Bio:</strong> {user.bio}</p>

          <button className="btn btn-secondary mt-3">Message</button>
        </div>
      </div>
    </div>
  );
};

export default UserProfile;
